import about from "./images/logo_about.png"
function SectionThird() {
    return (
        <div className="w-full h-auto border-2 py-20">
            <div className="flex flex-row mx-20">
                <div className="w-1/2 flex justify-center items-center">
                    <img src={about} />
                </div>
                <div className="w-1/2">
                    <h1 className=" font-sans font-bold text-5xl">Why Choose Us</h1>
                    <h3 className="font-sans font-bold text-3xl">We Simplify Trading</h3>
                    <p className=" font-sans font-thin text-xl "> Over time, TradEdge has evolved into a premier institution, empowering individuals with no prior market experience or knowledge to become consistent traders, capable of transforming their financial growth with confidence and expertise.</p>
                </div>
            </div>
        </div>
    );
}

export default SectionThird;
